    false,nt"url": null,nt"notes": "NCEI Accession 0146214 includes physical
    and underway data collected aboard the Sikuliaq during cruise SKQ201402S in the
    North Pacific Ocean and Philippine Sea from 2014-12-16 to 2015-01-15. These data
    include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
    COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
    These data were collected by Masako Tominaga of Michigan State University, and by
    University of Alaska - Fairbanks as part of Sentry JQZ Magnetics. The Lamont-Doherty
    Earth Observatory (LDEO) submitted these data to NCEI as part of the NSF sponsored
    Rolling Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
